import React from 'react'
import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import Row from 'react-bootstrap/Row';
import '../mainprofile.css';
export default function Mainprofile() {
  return (
     <div className = "profile-card Container">
      <div className = "cover-photo">
        <img src="https://scontent-ord5-1.xx.fbcdn.net/v/t1.6435-9/187478407_4226802877387666_7868680507561629665_n.jpg?_nc_cat=101&ccb=1-7&_nc_sid=5f2048&_nc_ohc=JrLBRK7JVeAQ7kNvgENZww8&_nc_ht=scontent-ord5-1.xx&oh=00_AYAQ8jEEVnTl671w21ttogb1geQnFz0saLx3s8VKBdzTJA&oe=66993535" alt="Cover Photo" className="cover-image" />
      </div>
      <div className="profile-image">
      <Col xs={2} md={2}>
          <Image src="https://images.pexels.com/photos/35537/child-children-girl-happy.jpg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2" roundedCircle />
        </Col>
      </div>
    </div>
  )
}
